    'tags'=>'SKU-17634,4mm de semilla de pe,7 0 checa semilla de,cordón,checa semilla de per',
    'language'=>'fr',
    'listing_id'=>216087470,
    'title'=>'60pcs Argent Violet PIP Perles de Verre tchèque PIP Preciosa PIP Perles tchèque Fleur Plate Pétale de Fleur de Perles 5mm x 7mm',
    );

    echo "THE LENGTH OF DESCRIPTION STRING IS ", mb_strlen($params['description'], 'utf-8'), " BUT WE HAVE SUCH ERROR:\n\n";
    $data = $oauth->fetch("https://openapi.etsy.com/v2/listings/216087470/translations/fr", $params, OAUTH_HTTP_METHOD_POST);
    
    
} catch (OAuthException $e) {
    error_log($e->getMessage());
    error_log(print_r($oauth->getLastResponse(), true));
    exit;
}

?>
