{"issue": {"id": 53207492, "url": "https://api.github.com/repos/brython-dev/brython/issues/87", "body": "String formatting is a little sluggish, and using the + operator is significantly faster than using a formatter. I wouldn't expect it to take half a second to format a thousand strings.

```
import time
def str_a():
    start = time.time()
    for _ in range(1000):
        a = "%s_%s" % ("hi", "there")
    end = time.time()
    print(end - start)

def str_b():
    start = time.time()
    for _ in range(1000):
        a = "hi" + "_" + "there"
    end = time.time()
    print(end - start)

str_a()
0.44900012016296387

str_b()
0.012000083923339844
```", "user": {"id": 6948206, "url": "https://api.github.com/users/JamesHutchison", "type": "User", "login": "JamesHutchison", "html_url": "https://github.com/JamesHutchison", "gists_url": "https://api.github.com/users/JamesHutchison/gists{/gist_id}", "repos_url": "https://api.github.com/users/JamesHutchison/repos", "avatar_url": "https://avatars.githubusercontent.com/u/6948206?v=3", "events_url": "https://api.github.com/users/JamesHutchison/events{/privacy}", "site_admin": false, "gravatar_id": "", "starred_url": "https://api.github.com/users/JamesHutchison/starred{/owner}{/repo}", "followers_url": "https://api.github.com/users/JamesHutchison/followers", "following_url": "https://api.github.com/users/JamesHutchison/following{/other_user}", "organizations_url": "https://api.github.com/users/JamesHutchison/orgs", "subscriptions_url": "https://api.github.com/users/JamesHutchison/subscriptions", "received_events_url": "https://api.github.com/users/JamesHutchison/received_events"}, "state": "open", "title": "string formatting performance", "labels": [], "locked": false, "number": 87, "assignee": null, "comments": 1, "html_url": "https://github.com/brython-dev/brython/issues/87", "closed_at": null, "milestone": null, "created_at": "2014-12-31T23:02:56Z", "events_url": "https://api.github.com/repos/brython-dev/brython/issues/87/events", "labels_url": "https://api.github.com/repos/brython-dev/brython/issues/87/labels{/name}", "updated_at": "2015-01-01T01:09:12Z", "comments_url": "https://api.github.com/repos/brython-dev/brython/issues/87/comments"}, "action": "created", "comment": {"id": 68477419, "url": "https://api.github.com/repos/brython-dev/brython/issues/comments/68477419", "body": "I'll see if I can take a crack at this tonight", "user": {"id": 6948206, "url": "https://api.github.com/users/JamesHutchison", "type": "User", "login": "JamesHutchison", "html_url": "https://github.com/JamesHutchison", "gists_url": "https://api.github.com/users/JamesHutchison/gists{/gist_