{"issue": {"id": 53124446, "url": "https://api.github.com/repos/yiisoft/yii2/issues/6697", "body": "
```php
// /index?r=site/index
echo Url::to(['site/index']);

// /index?r=site/index&src=ref1#name
echo Url::to(['site/index', 'src' => 'ref1', '#' => 'name']);

// the currently requested URL
echo Url::to();

// /images/logo.gif
echo Url::to('@web/images/logo.gif');

// images/logo.gif
echo Url::to('images/logo.gif');

// http://www.example.com/images/logo.gif
echo Url::to('@web/images/logo.gif', true);

// https://www.example.com/images/logo.gif
echo Url::to('@web/images/logo.gif', 'https');
```
The current `Url` support the above url style. 
some times I got new issue like.
```php
// add c parameter
// /index?r=site/index&src=ref1&a=b
echo Url::to(['c' => 'd']);
// get: /index?r=site/index&src=ref1&a=b&c=d

// just remove c parameter
// /index?r=site/index&src=ref1&a=b&c=d
echo Url::to(['c' => null]);
